import React, { useState } from 'react';
import { View, Text, StyleSheet, ScrollView, Image, TouchableOpacity, TextInput, CheckBox } from 'react-native';
import Nutzer from "./AlwaysActive/images/nutzer.png";
import Filter from "./AlwaysActive/images/filter.png";
import Squ4 from "./AlwaysActive/images/sq4.png";
import listic from "./AlwaysActive/images/listic.png";
import arrow from "./AlwaysActive/images/arrow.png";
import { personList } from '../Application/Classes/testDataGenerator';  // Importiere die Testdaten

const Persons = () => {
    const [searchText, setSearchText] = useState('');
    const [searchByFirstName, setSearchByFirstName] = useState(true);
    const [searchByLastName, setSearchByLastName] = useState(false);
    const [searchByBoth, setSearchByBoth] = useState(false);
    const [showFilters, setShowFilters] = useState(false);
    const [changeListView, setListView] = useState(true);

    // Funktion zum Filtern der Personenliste basierend auf den Suchkriterien
    const filteredPersons = personList.filter(person => {
        const fullName = `${person.firstName} ${person.lastName}`.toLowerCase();
        if (searchByFirstName) {
            return person.firstName.toLowerCase().includes(searchText.toLowerCase());
        } else if (searchByLastName) {
            return person.lastName.toLowerCase().includes(searchText.toLowerCase());
        } else if (searchByBoth) {
            return fullName.includes(searchText.toLowerCase());
        }
        return true;
    });

    return (
        <View style={styles.container}>
            <View style={{ flexDirection: "row" }}>
                <Text style={styles.welcomeText}>Personen</Text>

                <View style={styles.searchContainer}>
                    <View style={styles.borders}>
                        <TouchableOpacity
                            style={[styles.filterButton, changeListView && styles.activeButton]}
                            onPress={() => setListView(true)}
                        >
                            <Image style={{ width: 20, height: 20 }} source={Squ4} />
                        </TouchableOpacity>
                    </View>
                    <View style={styles.borders}>
                        <TouchableOpacity
                            style={[styles.filterButton, !changeListView && styles.activeButton]}
                            onPress={() => setListView(false)}
                        >
                            <Image style={{ width: 20, height: 20 }} source={listic} />
                        </TouchableOpacity>
                    </View>
                    <View style={{
                        borderWidth: 1,
                        borderColor: 'gray',
                        borderRadius: 5,
                        flexDirection: "row",
                        width: 400,
                    }}>
                        <TextInput
                            style={styles.searchBar}
                            placeholder="Search Personen"
                            value={searchText}
                            onChangeText={text => setSearchText(text)}
                        />
                        <TouchableOpacity style={styles.filterButton} onPress={() => setShowFilters(!showFilters)}>
                            <Image style={{ width: 20, height: 20 }} source={Filter} />
                        </TouchableOpacity>
                    </View>
                </View>
            </View>

            {/* Dropdown-Menü für Filter */}
            {showFilters && (
                <View style={styles.dropdown}>
                    <View style={styles.checkBoxItem}>
                        <CheckBox
                            value={searchByFirstName}
                            onValueChange={() => {
                                setSearchByFirstName(!searchByFirstName);
                                if (searchByFirstName) {
                                    setSearchByLastName(false);
                                    setSearchByBoth(false);
                                }
                            }}
                        />
                        <Text> Search by First Name</Text>
                    </View>
                    <View style={styles.checkBoxItem}>
                        <CheckBox
                            value={searchByLastName}
                            onValueChange={() => {
                                setSearchByLastName(!searchByLastName);
                                if (searchByLastName) {
                                    setSearchByFirstName(false);
                                    setSearchByBoth(false);
                                }
                            }}
                        />
                        <Text> Search by Last Name</Text>
                    </View>
                    <View style={styles.checkBoxItem}>
                        <CheckBox
                            value={searchByBoth}
                            onValueChange={() => {
                                setSearchByBoth(!searchByBoth);
                                if (searchByBoth) {
                                    setSearchByFirstName(false);
                                    setSearchByLastName(false);
                                }
                            }}
                        />
                        <Text> Search by Both</Text>
                    </View>
                </View>
            )}

            {/* Personenliste oder einfache Liste */}
            <ScrollView contentContainerStyle={styles.scrollViewContent}>
                {changeListView ? (
                    <View style={styles.personGrid}>
                        {filteredPersons.map((person, index) => (
                            <View key={index} style={styles.personBox}>
                                <TouchableOpacity>
                                    <View style={{ margin: 10 }}>
                                        <Image style={styles.images} source={Nutzer} />
                                    </View>
                                    <View style={{ backgroundColor: "lightgrey", height: 2, width: "100%", marginTop: 4, marginBottom: 4 }}></View>
                                    <View>
                                        <Text style={styles.personName}>{person.firstName}</Text>
                                        <Text style={styles.personName}>{person.lastName}</Text>
                                    </View>
                                </TouchableOpacity>
                            </View>
                        ))}
                    </View>
                ) : (
                    <View style={styles.simpleList}>
                        {filteredPersons.map((person, index) => (
                            <View style={{width:1300,flexDirection:"row"}} key={index}>
                                <View style={styles.simpleListItem}>
                                    <View style={{flexDirection:"row",width:1260}}>
                                        <Text style={{fontWeight:"bold"}}>{person.lastName}</Text>
                                        <Text> </Text>
                                        <Text>{person.firstName}</Text>
                                        <Text>... / TODO add imp params</Text>
                                    </View>
                                    <View>
                                        <TouchableOpacity>
                                            <Image style={{ width: 25, height: 25 }} source={arrow} />
                                        </TouchableOpacity>
                                    </View>
                                </View>
                            </View>
                        ))}
                    </View>
                )}
            </ScrollView>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        padding: 20,
        backgroundColor: '#fff',
        alignItems: 'flex-start',
    },
    welcomeText: {
        color: 'rgba(240,175,77,1)',
        fontWeight: "bold",
        fontSize: 50,
        marginBottom: 20,
    },
    searchContainer: {
        flexDirection: 'row',
        alignItems: 'center',
        marginBottom: 20,
        marginLeft: 635,
        width: '30%',
    },
    searchBar: {
        flex: 1,
        padding: 10,
    },
    filterButton: {
        padding: 10,
        borderRadius: 5,
    },
    activeButton: {
        backgroundColor: 'rgba(240,175,77,1)',
    },
    dropdown: {
        position: 'absolute',
        top: 70,
        left: 964,
        right: 20,
        backgroundColor: 'white',
        borderRadius: 5,
        padding: 10,
        elevation: 50,
        width: 400,
        zIndex: 10,
        borderWidth: 1,
        borderColor: 'lightgray',
    },
    checkBoxItem: {
        flexDirection: 'row',
        alignItems: 'center',
        marginBottom: 10,
    },
    scrollViewContent: {
        alignItems: 'center',
    },
    personGrid: {
        flexDirection: 'row',
        flexWrap: 'wrap',
    },
    personBox: {
        width: '15%',
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        padding: 2,
        marginBottom: 10,
        alignItems: 'center',
        justifyContent: 'center',
        height: 150,
        margin: 10,
    },
    personName: {
        fontSize: 14,
    },
    images: {
        width: 40,
        height: 40,
    },
    borders: {
        borderWidth: 1,
        borderColor: 'gray',
        borderRadius: 5,
        marginRight: 3,
    },
    simpleList: {
        padding: 10,
        backgroundColor: '#f9f9f9',
        borderRadius: 5,
        width: '100%',
    },
    simpleListItem: {
        flexDirection: "row",
        fontSize: 16,
        paddingVertical: 5,
        borderBottomWidth: 1,
        borderBottomColor: '#ddd',
    },
});

export default Persons;
